import React from 'react';

class Cliente extends React.Component{
  handleChange =(e)=>{
    this.setState({
      rut: e.target.value,
    })
  }
  handleClick =(e)=>{
    console.log('button was click')
  }
  render(){
    return(
      <div>
        <h1> Nuevo Cliente</h1>

        <form>
          <div className = 'form-group'>
            <label>Rut</label>
            <input onChange = {this.handleChange} className= 'form-control' type = 'text' name = 'rut'/>
          </div>
          <div className = 'form-group'>
            <label>Rut</label>
            <select id="">
            <option value="volvo">Volvo</option>
            <option value="saab">Saab</option>
            <option value="mercedes">Mercedes</option>
            <option value="audi">Audi</option>
            </select>
          </div>
          <div className = 'form-group'>
            <label>Nombre</label>
            <input onChange = {this.handleChange} className= 'form-control' type = 'text' name = 'nombre'/>
          </div>
          
          <button type = 'button' onClick ={this.handleClick} className = 'btn btn-primary'> guardar </button>
        </form>
      </div>
    );
  }
}

export default Cliente;
